#!/usr/bin/env python3

import sys, os, subprocess, shutil

class RPFWException(Exception):
	pass
	
class InfoException(Exception):
	pass
	
class RPFW:
	# konstruktor
	def __init__(self, mnt_path='/mnt/raspberry_rp2040_firware_upload/'):
		self.mnt_path = mnt_path
		self.rp_dev = None
		self.fw_file = None
		
	def _verify_uf2_header(self, uf2_header=b'\x55\x46\x32\x0A\x57\x51\x5D\x9E'):
		with open(os.path.abspath(self.fw_file), 'rb') as f:
			if f.read(8) != uf2_header:
				raise RPFWException(f'niewłaściwy nagłówek pliku firmware "{self.fw_file}"')
	
	def _check_pkgs(self):
		pkgs = {'sudo' : 'tsu', 'blkid' : 'blk-utils', 'findmnt' : 'util-linux'}
		miss = {}
		for k, v in pkgs.items():
			if not shutil.which(k):
				miss.update({k: v})
		if len(miss) > 0:
			raise RPFWException(f'brak pakietów: "{", ".join(miss.keys())}", aby je zainstalować wpisz: "pkg i {" ".join(miss.values())}"')
			
	def _test_sudo(self):
		try:
			subprocess.run(['sudo', 'true'], stdout=subprocess.DEVNULL, stderr=subprocess.DEVNULL, check=True)
		except FileNotFoundError:
			raise RPFWException('nie znaleziono pliku wykonywalnego "sudo"')
		except subprocess.CalledProcessError:
			raise RPFWException('"sudo" nie działa poprawnie')
			
	def _info(self):
		if len(sys.argv) != 2:
			raise InfoException(f'Użycie: {os.path.basename(sys.argv[0])} <plik_firmware.uf2>\n\n[RP w trybie bootloadera]:\nPrzytrzymaj chwilę przycisk BOOT[SEL] podczas [re]startu.')
		else:
			self.fw_file = sys.argv[1]
			
	def _check_fw(self):
		if not (os.path.exists(self.fw_file) and os.path.splitext(self.fw_file)[-1].lower() == ".uf2"):
			raise RPFWException('podaj właściwy plik firmware z rozszerzeniem ".uf2"')
		self._verify_uf2_header()

	def _scan(self):
		print('>> wykrywam RP ... ', end='', flush=True)
		try:
			self.rp_dev = subprocess.run(['sudo', 'blkid', '-l', '-n', 'vfat', '-o', 'device', '-t', 'LABEL=RPI-RP2'], check=True, stdout=subprocess.PIPE, stderr=subprocess.DEVNULL).stdout.decode().rstrip()
		except subprocess.CalledProcessError:
			raise RPFWException('sprawdź czy RP jest podłączone w trybie bootloadera')
		else:
			print(f'[OK]\n>> RP widoczne jako "{self.rp_dev}"')
			
	def _mount(self):
		if not os.path.ismount(self.mnt_path):
			print('>> montuję RP ... ', end='', flush=True)
			try:
				subprocess.run(['sudo', 'mkdir', '-p', self.mnt_path], check=True, stdout=subprocess.DEVNULL, stderr=subprocess.DEVNULL)
				subprocess.run(['sudo', 'mount', '-t', 'vfat', self.rp_dev, self.mnt_path], check=True, stdout=subprocess.DEVNULL, stderr=subprocess.DEVNULL)
			except subprocess.CalledProcessError:
				raise RPFWException(f'nie udało się zamontować "{self.mnt_path}"')
			else:
				print('[OK]')
			
	def _copy_fw(self):
		print('>> kopiuję firmware ... ', end='', flush=True)
		try:
			subprocess.run(['sudo', 'cp', '-f', os.path.abspath(self.fw_file), self.mnt_path], check=True, stdout=subprocess.DEVNULL, stderr=subprocess.DEVNULL)
		except subprocess.CalledProcessError:
			raise RPFWException(f'nie udało się skopiować fw')
		else:
			print('[OK]')
		
	def _umount(self):
		if os.path.ismount(self.mnt_path):
			print('>> odmontowuję i czyszczę ... ', end='', flush=True)
			try:
				subprocess.run(['sudo', 'umount', '-q', self.mnt_path], check=True, stdout=subprocess.DEVNULL, stderr=subprocess.DEVNULL)
				subprocess.run(['sudo', 'rm', '-fr', self.mnt_path], check=True, stdout=subprocess.DEVNULL, stderr=subprocess.DEVNULL)
			except subprocess.CalledProcessError:
				print('[BŁĄD]')
			else:
				print('[OK]')
		
	def run(self):
		self._check_pkgs()
		self._info()
		self._check_fw()
		self._test_sudo()
		self._scan()
		self._mount()
		self._copy_fw()
		self._umount()
		
		
if __name__ == "__main__":
	rp = RPFW()
	try:
		rp.run()
	except KeyboardInterrupt:
		print('\n>>> ctrl + c <<<\n')
	except RPFWException as e:
		print(f'\n[BŁĄD]: {e}\n')
	except InfoException as e:
		print(e)
	except BaseException as e:
		print(f'\n[STANDARDOWY BŁĄD]: {e}\n')
	except:
		print('\n[BŁĄD]: nieokreślony\n')
	finally:
		rp._umount()

