local function Compareprogress()
	if (skilllevel2 > weaponlevel2) then
		print("法寶進度小於技能進度");
		Compareweapentickets();
	elseif (skilllevel2 < weaponlevel2) then
		print("技能進度小於法寶進度");
		Compareskilltickets();
	else
		print("技能進度等於法寶進度");
		spawn(function()
			Compareskilltickets();
		end);
		Compareweapentickets();
	end
end
